    "Identity Verification In Progress": "S\u0259n\u0259din yoxlanmas\u0131 prosesi gedir",
    "If the course does not have an end date, learners always see their scores when they submit answers to assessments.": "\u018fg\u0259r kursun bitm\u0259 tarixi yoxdursa, t\u0259l\u0259b\u0259l\u0259r qiym\u0259tl\u0259ndirm\u0259nin cavablar\u0131n\u0131 daxil etdikd\u0259n sonra \u00f6z ballar\u0131n\u0131 g\u00f6r\u0259c\u0259kl\u0259r.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "\u018fg\u0259r altb\u00f6lm\u0259nin bitm\u0259 tarixi yoxdursa, t\u0259l\u0259b\u0259l\u0259r qiym\u0259tl\u0259ndirm\u0259nin cavablar\u0131n\u0131 daxil etdikd\u0259n sonra \u00f6z ballar\u0131n\u0131 g\u00f6r\u0259c\u0259kl\u0259r.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "\u018fg\u0259r d\u0259rs t\u0259l\u0259b\u0259l\u0259r\u0259 \u00f6nc\u0259d\u0259n a\u00e7\u0131l\u0131b d\u0259rc edilmi\u015fdirs\u0259, gizli oldu\u011fu zaman \u0259rzind\u0259 etdiyiniz b\u00fct\u00fcn d\u0259yi\u015fiklikl\u0259r art\u0131q t\u0259l\u0259b\u0259l\u0259r\u0259 g\u00f6rs\u0259n\u0259c\u0259k.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "\u018fg\u0259r d\u0259rs t\u0259l\u0259b\u0259l\u0259r\u0259 \u00f6nc\u0259d\u0259n a\u00e7\u0131l\u0131b d\u0259rc edilmi\u015fdirs\u0259, gizli oldu\u011fu zaman \u0259rzind\u0259 etdiyiniz b\u00fct\u00fcn d\u0259yi\u015fiklikl\u0259r art\u0131q t\u0259l\u0259b\u0259l\u0259r\u0259 g\u00f6rs\u0259n\u0259c\u0259k. Davam etm\u0259k ist\u0259yirsiniz?",
    "If you do not yet have an account, use the button below to register.": "\u018fg\u0259r sizin h\u0259l\u0259 d\u0259 hesab\u0131n\u0131z yoxdursa, o zaman a\u015fa\u011f\u0131dak\u0131 d\u00fcym\u0259d\u0259n istifad\u0259 ed\u0259r\u0259k qeydiyyatdan ke\u00e7in.",
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from %(platformName)s to verify your identity.": "\u018fg\u0259r siz \u00f6z kimliyinizi indi t\u0259sdiq etmirsinizs\u0259, siz \u00f6z panelinizd\u0259n kursu izl\u0259y\u0259 bil\u0259rsiniz. Siz periodik olaraq %(platformName)s-dan sizin kimliyinizi t\u0259sdiq etm\u0259k \u00fc\u00e7\u00fcn bildiri\u015fl\u0259r alacaqs\u0131n\u0131z.",
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from {platformName} to verify your identity.": "\u018fg\u0259r siz \u00f6z kimliyinizi indi t\u0259sdiq etmirsinizs\u0259, siz \u00f6z panelinizd\u0259n kursu izl\u0259y\u0259 bil\u0259rsiniz. Siz periodik olaraq {platformName} -dan sizin kimliyinizi t\u0259sdiq etm\u0259k \u00fc\u00e7\u00fcn bildiri\u015fl\u0259r alacaqs\u0131n\u0131z. ",
    "If you leave, you can no longer post in this team's discussions. Your place will be available to another learner.": "\u018fg\u0259r t\u0259rk ets\u0259niz, bu komandan\u0131n m\u00fczakir\u0259l\u0259rind\u0259 art\u0131q i\u015ftirak ed\u0259 bilm\u0259y\u0259c\u0259ksiniz. Sizin yeriniz ba\u015fqa bir \u015fagird\u0259 t\u0259klif olunacaqd\u0131r. ",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "\u018fg\u0259r \u0259sasl\u0131 d\u0259yi\u015fiklik edirsinizs\u0259, etm\u0259mi\u015fd\u0259n \u00f6nc\u0259 komanda \u00fczvl\u0259rini m\u0259lumatland\u0131r\u0131n. ",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "\u018fg\u0259r siz %(xblockType)s t\u0259l\u0259b\u0259l\u0259r\u0259 a\u00e7\u0131q ets\u0259niz, t\u0259l\u0259b\u0259l\u0259r m\u0259zmun d\u0259rd edildikd\u0259n v\u0259 d\u0259rc olunacaq vaxt\u0131 ke\u00e7dikd\u0259n sonra g\u00f6r\u0259c\u0259k. Ancaq m\u0259cburi qaydada gizl\u0259dilmi\u015f m\u0259zmun %(xblockType)s \u00fc\u00e7\u00fcn sazlaman\u0131 l\u0259\u011fv edildikd\u0259n sonra gizli qalacaq.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "\u018fg\u0259r altyaz\u0131s\u0131n\u0131 sils\u0259niz, bu altyaz\u0131 bu videonu istifad\u0259 ed\u0259n he\u00e7 bir komponentd\u0259 istifad\u0259 edil\u0259 bilm\u0259y\u0259c\u0259k.",
    "If you remove this transcript, the transcript will not be available for this component.": "Altyaz\u0131s\u0131n\u0131 sils\u0259niz, bu komponentin altyaz\u0131s\u0131 olmayacaqd\u0131r.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "\"%(hide_label)s\" - dan f\u0259rqli se\u00e7im ets\u0259niz, bu alt b\u00f6lm\u0259d\u0259 d\u0259rc edilmi\u015f materiallar  m\u0259cb\u00fcri qaydada gizl\u0259dilm\u0259diyi hal istisna olmaqla t\u0259l\u0259b\u0259l\u0259r\u0259 a\u00e7\u0131q olacaq.",
    "If you still wish to continue and delete your account, please enter your account password:": "Hesab\u0131n\u0131z\u0131 h\u0259qiq\u0259t\u0259n silm\u0259k ist\u0259yirsinizs\u0259, parolunuzu daxil edin.",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "T\u0259kmil Redaktoru istifad\u0259 ets\u0259niz, bu misal XML-\u0259 \u00e7evril\u0259c\u0259k v\u0259 Sad\u0259 Redaktora geri d\u00f6n\u0259 bilm\u0259y\u0259c\u0259ksiniz.\n\nT\u0259kmil Redaktora davam etm\u0259kl\u0259 misal XML-\u0259 \u00e7evrilsin?",
