    "Learners do not see whether their answers to assessments were correct or incorrect, nor the score received, until after the due date for the subsection has passed.": "T\u0259l\u0259b\u0259l\u0259r tap\u015f\u0131r\u0131qlara verdikl\u0259ri cavablar\u0131n d\u00fczg\u00fcn olub olmad\u0131\u011f\u0131n\u0131 v\u0259 ald\u0131\u011f\u0131 qiym\u0259ti alt b\u00f6lm\u0259ni bitir\u0259n\u0259 g\u0259d\u0259r g\u00f6rm\u00fcrl\u0259r. ",
