    "The combined length of the organization, course number, and course run fields cannot be more than <%=limit%> characters.": "T\u0259\u015fkilat\u0131n \u00fcmumi uzunlu\u011fu, kurs say\u0131lar\u0131 v\u0259 kursun gedi\u015fat sah\u0259l\u0259ri <% = limit%> simvoldan \u00e7ox ola bilm\u0259z.",
