    "The following email addresses and/or usernames are invalid:": "A\u015fa\u011f\u0131dak\u0131 e-mail \u00fcnvanlar\u0131 v\u0259/v\u0259 ya istifad\u0259\u00e7i adlar\u0131 etibars\u0131zd\u0131r:",
