    "The following options are available for the {license_name} license.": "{license_name} lisenziyas\u0131 \u00fc\u00e7\u00fcn a\u015fa\u011f\u0131dak\u0131 \u015f\u0259rtl\u0259r m\u00f6vcuddur.",
    "The following users are no longer enrolled in the course:": "A\u015fa\u011f\u0131dak\u0131 istifad\u0259\u00e7il\u0259r art\u0131q bu kursa qeydiyyatda deyill\u0259r:",
