    "The language used throughout this site. This site is currently available in a limited number of languages. Changing the value of this field will cause the page to refresh.": "Bu dil sayt boyunca istifad\u0259 edildi. Hal-haz\u0131rda saytda m\u0259hdud sayda dill\u0259rin istifad\u0259si m\u00fcmk\u00fcnd\u00fcr. Bu sah\u0259nin d\u0259y\u0259rinin d\u0259yi\u015fdirilm\u0259si s\u0259hif\u0259nin yenil\u0259nm\u0259sin\u0259 s\u0259b\u0259b olacaq.",
