    "The minimum grade for course credit is not set.": "Kurs krediti \u00fc\u00e7\u00fcn minimum d\u0259r\u0259c\u0259 m\u00fc\u0259yy\u0259nl\u0259\u015fdirilm\u0259yib.",
    "The minimum score percentage must be a whole number between 0 and 100.": "Minimal ke\u00e7id bal\u0131 faiz il\u0259 0 v\u0259 100 aras\u0131nda tam \u0259d\u0259d olmal\u0131d\u0131r.",
