    "The name that identifies you on {platform_name}. You cannot change your username.": "Bu ad sizin {platform_name} portal\u0131nda istifad\u0259 etdiyiniz add\u0131r. Siz istifad\u0259\u00e7i ad\u0131n\u0131z\u0131 d\u0259yi\u015fdir\u0259 bilm\u0259zsiniz. ",
    "The name that is used for ID verification and that appears on your certificates.": "\u0130D yoxlan\u0131lmas\u0131nda v\u0259 sertifikatda qeyd olunacaq ad",
