    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "T\u0259l\u0259b\u0259l\u0259ri n\u0259zar\u0259t\u0259 t\u0259qdim etm\u0259k \u00fc\u00e7\u00fcn adaptasiyadan istifad\u0259 edin, onlar\u0131n \u015f\u0259xsiyy\u0259tini t\u0259sdiql\u0259yin v\u0259 adaptasiya profili yarad\u0131n. T\u0259l\u0259b\u0259l\u0259r n\u0259zar\u0259tli imtahana daxil olmadan \u00f6nc\u0259 adaptasiya profill\u0259rini doldurmal\u0131d\u0131rlar. Profil bax\u0131\u015flar\u0131 2+ i\u015f g\u00fcn\u00fc \u0259rzind\u0259 tamamlan\u0131r. ",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "T\u0259l\u0259b\u0259l\u0259ri imtahanlara haz\u0131rlamaq \u00fc\u00e7\u00fcn imtahan al\u0259t v\u0259 prosesl\u0259rind\u0259n istifad\u0259 edin. S\u0131naq imtahan\u0131n\u0131n n\u0259tic\u0259si yekun qiym\u0259t\u0259 t\u0259sir etmir.  ",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Bu alt b\u00f6lm\u0259d\u0259 t\u0259l\u0259b\u0259l\u0259rin tap\u015f\u0131r\u0131qlar\u0131na vaxt m\u0259hdudiyy\u0259ti qoymaq \u00fc\u00e7\u00fcn vaxt m\u0259hdudiyy\u0259tli imtahandan istifad\u0259 edin. T\u0259l\u0259b\u0259l\u0259r cavablar\u0131 vaxt bit\u0259n\u0259 q\u0259d\u0259r g\u00f6nd\u0259rm\u0259lidirl\u0259r. M\u00fc\u0259yy\u0259n t\u0259l\u0259b\u0259l\u0259r \u00fc\u00e7\u00fcn \u0259lav\u0259 vaxt\u0131 m\u00fc\u0259llimin  idar\u0259etm\u0259 paneli vasit\u0259sil\u0259 \u0259lav\u0259 ed\u0259 bil\u0259rsiniz.",
    "Use as a Prerequisite": "M\u00fcq\u0259ddim\u0259 kimi istifad\u0259 et",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "\u018flf\u0259cinl\u0259rd\u0259n istifad\u0259 siz\u0259 kurs siyah\u0131s\u0131na rahatl\u0131qla qay\u0131tman\u0131za k\u00f6m\u0259k ed\u0259c\u0259k. S\u0259hif\u0259ni \u0259lf\u0259cinl\u0259r siyah\u0131s\u0131na \u0259lav\u0259 etm\u0259k \u00fc\u00e7\u00fcn s\u0259hif\u0259nin ba\u015fl\u0131\u011f\u0131n\u0131n alt\u0131nda yerl\u0259\u015f\u0259n \"\u018flf\u0259cinl\u0259r\u0259 \u0259lav\u0259 et\" - i s\u0131x\u0131n.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "Qruplardan m\u00fczakir\u0259l\u0259ri b\u00f6lm\u0259kd\u0259 \u0259sas kimi istidad\u0259 edin. B\u00fct\u00fcn \u015fagirdl\u0259r qrupdan as\u0131l\u0131 olmayaraq eyni m\u00fczakir\u0259 m\u00f6vzular\u0131n\u0131 g\u00f6r\u00fcrl\u0259r, ancaq b\u00f6l\u00fcnm\u00fc\u015f m\u00f6vzular i\u00e7\u0259risind\u0259 yaln\u0131z eyni eyni qrupun \u015fagirdl\u0259ri m\u00f6vzular\u0131 g\u00f6r\u0259 v\u0259 bir-biril\u0259rinin postlar\u0131na cavab ver\u0259 bil\u0259rl\u0259r. ",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "Qeydiyyat yollar\u0131ndan m\u00fczakir\u0259l\u0259ri b\u00f6lm\u0259kd\u0259 \u0259sas kimi istidad\u0259 edin. B\u00fct\u00fcn \u015fagirdl\u0259r qeydiyyat yoluna baxmayaraq eyni m\u00fczakir\u0259 m\u00f6vzular\u0131n\u0131 g\u00f6r\u00fcrl\u0259r, ancaq b\u00f6l\u00fcnm\u00fc\u015f m\u00f6vzular i\u00e7\u0259risind\u0259 yaln\u0131z eyni qeydiyyat yolunda olan \u015fagirdl\u0259r m\u00f6vzular\u0131 g\u00f6r\u0259 v\u0259 bir-biril\u0259rinin postlar\u0131na cavab ver\u0259 bil\u0259rl\u0259r. ",
